import {takeEvery} from "redux-saga/effects";
import {createUserSaga} from "./userSaga";
import {requestToGoogleSaga} from './requestToGoogleSaga';
import { callBackGoogleSaga } from "./callBackGoogleSaga";

function* rootSaga(){
  yield takeEvery('users/requestToGoogle', requestToGoogleSaga);
  yield takeEvery('users/createUserRequest', createUserSaga);
  yield takeEvery('users/callBackGoogle1', callBackGoogleSaga);
};

export default rootSaga;
